import {AUTH,LOGOUT} from '../actions/actiontype';

const authReducer = (state={authData:null},action)=>{
    switch(action.type){
        case AUTH:
            console.log(action?.data);
            break;
       case LOGOUT:
          return state;
        default:
            break;
    }
}
export default authReducer;
